funcReserve:
  function funcReserve() {
    log("funcReserve");

    const tag = localStorage.getItem("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      LOGOUT();
      return;
    }
    localStorage.setItem("TZ_LOGOUT", new Date().getTime());

    TZLOG(logParam, (data) => {});
    let sign = fulldate.daySign();
    if (sign != 1) sign = 2;
    timefrom_change(fulldate, sign, fulldate.dayNum(), "", "00", "T");
    timer(2000, funcTime);
  }

funcTime:
  function funcTime() {
    log("funcTime");
    log("timeresbtn_" + dictCourse[course] + "_" + time);

    timelist_view('0');
    timer(500, exec);

    function exec() {
      const els = doc.gcn("cm_time_list_tbl")[0].gtn("tbody")[0].gtn("tr");
      let target;
      els.every(el => {
        const param = el.attr("onclick").inparen();
        const [, elCourse, elTime] = param;
        const sign = dictCourse[course];

        log(time, elTime, sign, elCourse);
        log(time == elTime, sign == elCourse);

        if(time == elTime, sign == elCourse) target = el;

        return !target;
      });
  
      log("target", target);
      if (target) {
        target.click();
        timer(500, funcExec);
      } else {
        LOGOUT();
      }
    }

  }

funcExec:
  function funcExec() {
    log("funcExec");
    const num = golfTimeDiv2CertNo.str();
    certNoChk.value = num;
    window["agree_chk"][0].click();

    doc.gcn("cm_btn default")[0].click();
  }

funcEnd:
function funcEnd() {
  log("funcEnd");
  const strEnd = "end of reserve/reserve";
  logParam.message = strEnd;
  TZLOG(logParam, (data) => {});
  const ac = window.AndroidController;
  if (ac) ac.message(strEnd);
}
